import React, { Fragment } from "react";
import { Box, IconButton, styled } from "@mui/material";
import CropIcon from '@mui/icons-material/Crop';

const UploadPhotoCardHover = ({formData, setFormData}) =>{
      const uploadPhotoCardHoverButton = styled(IconButton) ({
            width: 18,
            height: 18,
            position: 'absolute',
            top: 5,
            right: 5, 
            color:"primary",
            ariaLabel:"Crop Photo",
            backgroundColor: 'white',
            borderRadius: '3px',
      });

      return(
            <Fragment position="relative">
                  <Box sx={{
                        width: 220,
                        height: 220,
                        position: 'absolute',
                        top: 0,
                        left: 0
                  }}>
                        <img width={220} height={220} src={formData.uploadedPhotos.slice(-1)} alt="uploadedPhoto" />
                        <uploadPhotoCardHoverButton component="label">
                              <CropIcon sx={{
                                    width: 14
                              }}/>
                        </uploadPhotoCardHoverButton>
                  </Box>
            </Fragment>
      );
}

export default UploadPhotoCardHover;
